import React from 'react';
import { IHomeProps } from '../types/types';

const Home = (props: IHomeProps) => {

    return (
        <>
            <p>Dies ist ein Projekt im Rahmen einer Masterarbeit des <a href='https://www.geographie.ruhr-uni-bochum.de/news/'>Geographischen Instituts der Ruhr-Universität Bochum.</a></p>
            <p>Dabei sollen <b>freiwillig & anonymisiert</b>Daten von an <b>Corona erkrankten Personen im Stadtgebiet Kölns</b> erhoben werden.</p>
            <p>Ziel ist es darüber Erkenntnisse zu erlangen wie Corona-Fälle kleinräumig auf Stadtteilebene innerhalb Kölns verteilt sind und inwiefern <b>freiwillig erhobene Daten</b> einen Beitrag dazu leisten können.</p>
            <p>Über die untenstehenden Buttons findest du eine Anleitung zur Datenerhebung und Informationen zum Datenschutz.</p>
        </>
    );
};

export default Home;
